import React from "react";
import { Grid } from "semantic-ui-react";
export const GridContainer = () => (
  <Grid columns="three" divided>
    <Grid.Row>
      <Grid.Column>
        <span>Text</span>
      </Grid.Column>

      <Grid.Column>
        <span>Text</span>
      </Grid.Column>

      <Grid.Column>
        <span>Text</span>
      </Grid.Column>
    </Grid.Row>
  </Grid>
);

export default GridContainer;
